import React, { Component } from "react";
import "./main.css";
export default class Survey1 extends Component {
  state = {
    Name: "",
    PT: "",
    PN: "",
    Gmail: "",
    Address: "",
    In: "",
    Major: "",
    NOU: "",
    Degree: "",
    Skills: "",
    Profile: "",
    WE: "",
    JT: ""
  };
  handleName = e => {
    this.setState({
      Name: e.target.value
    });
  };

  handlePT = e => {
    this.setState({
      PT: e.target.value
    });
  };
  handelPN = e => {
    this.setState({
      PN: e.target.value
    });
  };
  handelgmail = e => {
    this.setState({
      Gmail: e.target.value
    });
  };
  handeladdress = e => {
    this.setState({
      Address: e.target.value
    });
  };
  handelin = e => {
    this.setState({
      In: e.target.value
    });
  };
  handelmajor = e => {
    this.setState({
      Major: e.target.value
    });
  };
  handelNOU = e => {
    this.setState({
      NOU: e.target.value
    });
  };
  handeldegree = e => {
    this.setState({
      Degree: e.target.value
    });
  };
  handelskills = e => {
    this.setState({
      Skills: e.target.value
    });
  };
  handelprofile = e => {
    this.setState({
      Profile: e.target.value
    });
  };
  handelWE = e => {
    this.setState({
      WE: e.target.value
    });
  };
  handelJT = e => {
    this.setState({
      JT: e.target.value
    });
  };

  getLink = () => {
    var Name = this.state.Name;
    var PT = this.state.PT;
    var PN = this.state.PN;
    var Gmail = this.state.Gmail;
    var Address = this.state.Address;
    var In = this.state.In;
    var Major = this.state.Major;
    var NOU = this.state.NOU;
    var Degree = this.state.Degree;
    var Skills = this.state.Skills;
    var Profile = this.state.Profile;
    var WE = this.state.WE;
    var JT = this.state.JT;

    var fLink =
      "/res/" +
      Name +
      "/" +
      PT +
      "/" +
      PN +
      "/" +
      Gmail +
      "/" +
      Address +
      "/" +
      In +
      "/" +
      Major +
      "/" +
      NOU +
      "/" +
      Degree +
      "/" +
      Skills +
      "/" +
      Profile +
      "/" +
      WE +
      "/" +
      JT;
    window.location.href = fLink;
  };
  render() {
    return (
      <div className="App-header">
        <p>Fill in the following survey</p>
        <input
          className="txtboxes"
          placeholder="Enter your name"
          onChange={this.handleName}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Proffesional title"
          onChange={this.handlePT}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Phone Number"
          onChange={this.handlePN}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Gmial address"
          onChange={this.handelgmail}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Address"
          onChange={this.handleaddress}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your IN"
          onChange={this.handlein}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your major"
          onChange={this.handlemajor}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter the name of ypur university"
          onChange={this.handleNOU}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your degree"
          onChange={this.handledegree}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your skills"
          onChange={this.handleskills}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Profile"
          onChange={this.handleprofile}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your work experience"
          onChange={this.handleWE}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your job title"
          onChange={this.handleJt}
        />
        <br />
        <button className="button_a" onClick={this.getLink}>
          GO TO THE NEXT PAGE.
        </button>
      </div>
    );
  }
}
